/* Type of SQL : MySQL  */
DROP DATABASE IF EXISTS ALCOHOL_SALES_DATABASE;
CREATE DATABASE ALCOHOL_SALES_DATABASE;
USE ALCOHOL_SALES_DATABASE;

CREATE TABLE CATEGORY (
    CATEGORY_ID INT PRIMARY KEY,
    CATEGORY_NAME VARCHAR(45) UNIQUE,
    CATEGORY_TAX_FAMILY VARCHAR(45),
    CATEGORY_DESCRIPTION VARCHAR(256)
);

-- Insert 87 records into CATEGORY table

-- Create the SUPPLIER table
CREATE TABLE SUPPLIER (
    SUPPLIER_ID INT PRIMARY KEY,
    SUPPLIER_NAME VARCHAR(45) UNIQUE,
    SUPPLIER_CONTACT VARCHAR(45)
);

-- Insert 35 records into SUPPLIER table

CREATE TABLE LOCATION (
    LOCATION_ID INT PRIMARY KEY AUTO_INCREMENT,
    LOCATION_NAME VARCHAR(45),
    LOCATION_ADDRESS VARCHAR(100)
);


CREATE TABLE CUSTOMER(
	CUSTOMER_ID INT PRIMARY KEY NOT NULL,
    CUSTOMER_NAME VARCHAR(45) NOT NULL,
    CUSTOMER_CONTACT VARCHAR(45) NOT NULL,
    PRICE_TIER TINYINT NOT NULL
);


CREATE TABLE PRODUCT (
	PRODUCT_SKU BIGINT NOT NULL,
	PRODUCT_NAME VARCHAR(45) NOT NULL,
	PRODUCT_BARCODE BIGINT,
	PRICE_TIER_1 DECIMAL(10,5) NOT NULL, 
	PRICE_TIER_2 DECIMAL(10,5) NOT NULL,
	PRICE_TIER_3 DECIMAL(10,5) NOT NULL,
	SUPPLIER_ID INT,
    CATEGORY_ID INT,
	COST_OF_GOODS_SOLD DECIMAL(10,5) NOT NULL,
	DESCRIPTION VARCHAR(256),	
    PRIMARY KEY (PRODUCT_SKU),
    FOREIGN KEY (CATEGORY_ID) REFERENCES CATEGORY(CATEGORY_ID),
    FOREIGN KEY (SUPPLIER_ID) REFERENCES SUPPLIER(SUPPLIER_ID)
);


CREATE TABLE Invoice (
    INVOICE_ID INT NOT NULL,
    INVOICE_DATE DATE NOT NULL,
    CUSTOMER_ID INT NOT NULL,
    INVOICE_TOTAL DECIMAL(10, 2),
    PRIMARY KEY (INVOICE_ID),
    FOREIGN KEY (CUSTOMER_ID) REFERENCES Customer(CUSTOMER_ID)
);


DELIMITER //
CREATE TRIGGER UpdateInvoiceTotal
AFTER INSERT ON Transaction
FOR EACH ROW
BEGIN
    UPDATE Invoice
    SET INVOICE_TOTAL = (
        SELECT IFNULL(SUM(t.QUANTITY * t.TRANSACTION_PRICE), 0)
        FROM Transaction t
        WHERE t.INVOICE_ID = NEW.INVOICE_ID
    )
    WHERE INVOICE_ID = NEW.INVOICE_ID;
END;
//
DELIMITER ;


-- Create the Transaction table
CREATE TABLE Transaction (
    Transaction_ID INT PRIMARY KEY,
    INVOICE_ID INT NOT NULL,
    PRODUCT_SKU BIGINT NOT NULL,
    QUANTITY INT NOT NULL,
    TRANSACTION_PRICE DECIMAL(5, 2) NOT NULL,
    FOREIGN KEY (INVOICE_ID) REFERENCES INVOICE(INVOICE_ID),
	FOREIGN KEY (PRODUCT_SKU) REFERENCES PRODUCT(PRODUCT_SKU)
);

-- Insert rows into the Transaction table


CREATE TABLE EMPLOYEE (
    EMPLOYEE_ID INT PRIMARY KEY AUTO_INCREMENT,
    EMPLOYEE_NAME VARCHAR(45) NOT NULL,
    EMPLOYEE_ROLE VARCHAR(45),
    LOCATION INT,
    EMPLOYEE_HOURLY_RATE FLOAT,
    CONSTRAINT FK_LOCATION FOREIGN KEY (LOCATION) REFERENCES LOCATION(LOCATION_ID)
);


CREATE TABLE INVENTORY (
    INVENTORY_QUANTITY INT NOT NULL,
    PRODUCT_SKU BIGINT NOT NULL,
    LOCATION_ID INT NOT NULL,
    PRIMARY KEY (PRODUCT_SKU, LOCATION_ID),
    FOREIGN KEY (PRODUCT_SKU) REFERENCES Product(PRODUCT_SKU),
    FOREIGN KEY (LOCATION_ID) REFERENCES Location(LOCATION_ID)
);


